        [Fact]
        public void DecodeJpgXrBgr24()
        {
            byte[] jpgXrBgr24 = GetJpgXrBgr24();

            // this test is operating on "interop"-level
            var instance = ImgDoc2ApiInterop.Instance;
            var decompressed = instance.DecodeJpgXr(jpgXrBgr24, PixelType.Bgr24, 120, 55);

            using (var md5 = MD5.Create())
            {
                // Convert Memory<byte> to Span<byte> for hashing
                Span<byte> dataSpan = decompressed.Span;

                // You might need to cast to ReadOnlySpan<byte> depending on your environment
                // var hash = md5.ComputeHash(dataSpan.ToArray()); // Alternative approach

                var computedHash = md5.ComputeHash(dataSpan.ToArray());

                byte[] expectedHash = new byte[] { 0x04, 0x77, 0x2f, 0x32, 0x2f, 0x94, 0x9b, 0x07, 0x0d, 0x53, 0xa5, 0x24, 0xea, 0x64, 0x5a, 0x1a };
                computedHash.Should().Equal(expectedHash, because: "the computed hash should match the expected hash");
            }
        }

